  background-color: #8b0000; /* Dark red color */
  color: #fff;
  padding: 1rem;
  display: flex;
  justify-content: center;
  align-items: center;
  font-size: 0.9rem;
`;

const FooterText = styled.p`
  margin: 0;
`;

